/* General */
html {-ms-text-size-adjust:100%;-webkit-text-size-adjust:100%}
body { height: 100vh; color: #1f1f1f; background: white;font-family: 'Nunito Sans', sans-serif;margin: 0; }
main {margin: 0 auto; text-align: justify;}
.seccion1 {text-align: center;width:100%;margin-top: 60px;padding-top: 10px;padding-bottom: 30px;}
.seccion1 .row, .seccion2 .row {justify-content: center}
.seccion2 {width: 100%;margin-top: 40px;}
.seccion3 {width: 100%;margin-top: 40px;}
.seccion4 {width: 100%;margin-top: 40px;padding-bottom: 30px;}
.seccion4B {width: 100%;margin-top: 40px;}
.seccion4A {width: 100%;margin-top: 40px;}
.seccion5 {width: 100%;padding-bottom: 30px;}
.background-lightblue {background-color: #D5E2F2;}
.background-orange{/* Permalink - use to edit and share this gradient: https://colorzilla.com/gradient-editor/#a66617+50,fcfcfc+50,ffffff+50 */
    background: #a66617; /* Old browsers */
    background: -moz-linear-gradient(top,  #a66617 50%, #fcfcfc 50%, #ffffff 50%); /* FF3.6-15 */
    background: -webkit-linear-gradient(top,  #a66617 50%,#fcfcfc 50%,#ffffff 50%); /* Chrome10-25,Safari5.1-6 */
    background: linear-gradient(to bottom,  #a66617 50%,#fcfcfc 50%,#ffffff 50%); /* W3C, IE10+, FF16+, Chrome26+, Opera12+, Safari7+ */
    filter: progid:DXImageTransform.Microsoft.gradient( startColorstr='#a66617', endColorstr='#ffffff',GradientType=0 ); /* IE6-9 */}
.background-grey{background-color:#8C8377;}
.background-white{background-color:white;}


/*layout */
.row {width: 100%;display: flex;flex-wrap: wrap}
.row .col {padding: 0 15px}
.row .col-3 {width: 100%}
.row .col-6 {width: 100%}
.m-l-20 {margin-left:20px}
.m-r-20 {margin-right:20px}
.m-b-20 {margin-bottom: 20px;}
.p-x-30 {padding-left:30px; padding-right: 30px;}
.p-x-50 {padding-left:50px; padding-right: 50px;}
.float-left {float:left}
.float-right {float: right}

/* Navigation */
nav {height: 70px;width: 100%;margin: 0 auto; background:#D5E2F2;font-size: 20px;position: absolute;}
nav ul {padding-top: 15px;margin-top:0px;position: center;text-align: center;}
nav ul li {vertical-align:middle;display: inline;font-family: Amatic SC, cursive;font-size: 30px;}
nav ul li a {vertical-align: middle;color:#733E10;text-transform: uppercase;font-weight: 700;font-style: bold;text-decoration: none;padding: 0 30px;}

/* Multimedia */
.banner {height: 450px;width: 100%;margin: 0 auto;position: relative;}
.banner h1 {position:absolute;width:100%;left: 0;top: 10%;color:#D5E2F2;text-shadow: 1px 2px 4px black;font-size: 70px;font-family: Amatic SC, cursive;text-align: center;}
.banner br {position: absolute;left: 450px;color:#D5E2F2;text-shadow: 1px 2px 4px black;font-size: 10px;font-family: Amatic SC, cursive;}
.banner img{height: 450px;width: 100%;object-fit: cover;}
.object-banner-fermentos img{object-position: center 90%;}
.object-banner-procesos img{object-position: center top;}
.object-banner-inicio img{object-position: center 30%;}
.object-banner-uvas img{object-position: center 60%;}
.object-banner-coles img{object-position: center 60%;}
.logo img{position:absolute;height:60px;width:60px;margin-left: 10px;margin-top: 5px;}
.logo1 img{height:200px;width:200px;bottom: 40px;}
.logo1 {width: 100%; margin: 0 auto;}
.logo1 a{width: 100%;display: inline-block;text-align: center;}
.video {margin: 20 auto;text-align: center;}
.video iframe {margin: 0 auto}
.imagen, .imagen_vertical {display: inline-block;}
.imagen img{height:auto; width: 300px;float: right;position: center;margin-bottom: 15px;}
.imagen img.float-left {float: left; margin-right: 20px;}
.imagenfermentos img{height: 300px;width: 300px;margin-left: 50px;margin-bottom: 20px;float: left;position: center;}
.instagram {width: 600px;display: flex; flex-direction:row; flex-wrap: wrap; margin:0 auto;}
.instagram .object-fit {height: 200px;width: 50%;transition: 1s ease}
.instagram .object-fit:hover{clip-path: circle(100px, 100px, 100px); clip-path: circle(100px at center);}
.instagram img{height: 200px;width: 100%;object-fit: cover;}
.instagram-logo {height: 24px;width: 24px;padding-top: 5px;}
.instagram-logo path {fill:white;}
.instagram-logo .logo {fill: white;}
.imagen_vertical img{height: 600px;float: left;margin-bottom: 20px;}
.img-responsive {width: 100%;height: auto;}
.col-3 .object-fit {width: 100%;height: 250px;}
.col-6 .object-fit {width: 100%;height: 250px;margin-top: 30px;}
.object-fit-600 {height: 600px;width: 100%;}
.object-fit-300 {height: auto;width: 300px;}
.object-fit-300 img{height: auto;width: 300px;object-fit: cover;}
.img-h-250 {height: 250px;width: auto;}
.img-h-250 {height: 250px;width: 100%; object-fit: cover;}
.img-h-450 {height: 450px;width: auto;}
.img-h-450 {height: 450px;width: 100%; object-fit: cover; object-position: center top;}
.img-h-600 {height: 600px;width: 100%;object-fit: cover;}
.object-p-top {object-position: center top;}
.object-p-center {object-position: center center;}


/* Text */
.h2 {text-align:center;margin-top: 150px;color: #8C8377;font-family: Courier Prime;font-size: 28px;}
.h2 a{text-align:center;margin-top: 0px;color:black; text-decoration: none;}
.h3 {text-align: center;color:#733E10;font-family: Amatic SC, cursive;font-size: 50px;font-style: bold;margin-top: 30px;}
.texto {top: 40px;bottom: 300px;color:#8C8377;font-family: Courier Prime;text-align: center;font-size: 20px;margin-top: 20px;font-weight: 400;line-height: 1.7;}
.texto1 {color:white; font-family: Courier Prime;font-size: 30px; padding-top: 60px;}
.texto2 {color:white; font-family: Courier Prime;font-size: 20px;line-height: 40px;text-decoration: none;}
.texto3 {text-align:center;margin-top: 150px;color:white;font-family: Courier Prime;font-size: 28px;padding-top: 40PX;}
.texto4 {text-align:center;margin-top: 150px;color:white;font-family: Courier Prime;font-size: 16px;margin-top: 10px;text-decoration: none;line-height: 1px;font-style: normal;}
.parrafo {text-align:justify;margin-top: 0;color:#8C8377;font-family: Courier Prime;font-size: 18px;text-decoration: none;font-style: normal;line-height: 1.7;}


.cita {font-style: italic;}
.boton {font-family: Courier Prime;font-size: 20px;font-weight:700;color:#733E10;padding: 10px 50px;border-radius: 5px; text-decoration: none;margin-top: 10px;display: inline-block;}
.text-center {text-align: center;}
.enlace li{margin-top: 20px;}
.enlace li a{color: black;font-size: 18px;}

/* Footer */
footer {background:#8C8377;height:150px;width: 100%;color:white;text-align: center;padding-top: 40px;}
footer .m-t-50{margin-top: 50px}
footer ul {padding-top: 15px;padding-bottom:20px;margin-top:0px;position: center;text-align: center;}
footer ul li {vertical-align:middle;display: inline;font-family: Amatic SC, cursive;font-size: 24px;}
footer ul li a {vertical-align: middle;color:white;text-transform: uppercase;font-weight: 700;font-style: bold;text-decoration: none;padding:0 10px;}

/* Media queries */
.d-xs-show{
    display: none;
}
@media (max-width: 768px) {
    iframe {
        width: 100% !important;
    }
    nav ul {
        padding: 2px;
        margin-top: 5px;
        margin-left: 0px;
    }
    nav ul li a {
        padding:0 0px;
        font-size: 20px;
        margin-left: 40px;
    }
    .imagen img {
        height: auto;
        width: 100%;
    }
    .d-xs-show{
        display: initial;
    }
    .mb-xs-40{
        margin-bottom: 40px;
    }
    .instagram {
        width: 100%;
    }
    .instagram .object-fit {
        width: 100%;
    }
    .logo img {
        height: 40px;
        width: 40px;
        margin-left: 10px;
        margin-top: 12px;
    }
    .svg-boton {
        display: block;
    }
  }

@media (min-width:834px) {
    .banner h1 {top: 50px;font-size: 100px;}
    .banner br {top: 50px;font-size: 100px;}
    nav ul li a {padding: 0 40px;}
    .logo img{margin-left: 40px;}
}
@media (min-width:1024px) {
    .banner h1 {top: 25px;font-size: 100px;}
    .banner br {top: 25px;font-size: 100px;}
    nav ul li a {padding: 0 50px;}
    .logo img{margin-left: 60px;}
    .row .col-3 {width: 40%}
    .row .col-6 {width: 50%}
}
@media (min-width:1280px) {
    .banner h1 {top: 10px;font-size: 100px;}
    .banner br {top: 10px;font-size: 100px;}
    nav ul li a {padding: 0 80px;}
    .logo img {margin-left: 50px;}
    .row .col-3 {width: 35%}

}


/*Animation*/
.inline-photo {
    opacity: 0;
    transform: translateY(4em) rotateZ(-5deg);
    transition: transform 4s .25s cubic-bezier(0,1,.3,1),
                opacity .3s .25s ease-out;
    will-change: transform, opacity;
  }

  .inline-photo.is-visible {
    opacity: 1;
    transform: rotateZ(0deg);
  }

  .imagewrapperanimation {
    transition: 0.5s ease;
    overflow: hidden;
  }
  .imagewrapperanimation:hover {
    transform: scale(0.89);
  }

/*svg animation*/
  .svg-boton{transition: 0.5s ease;color:white;text-decoration: none;}
  .svg-boton:hover{color:#D5E2F2;}
  .svg-boton:hover svg path{fill:#D5E2F2}
  .svg-boton:hover svg circle{fill:#D5E2F2}
